CREATE FUNCTION generate_str_uuid()
    RETURNS TEXT
    LANGUAGE sql as
$$
SELECT string_agg(substr('ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789', ceil(random() * 62)::integer,
                         1), '')
FROM generate_series(1, 24)
$$;

CREATE TABLE customers
(
    customer_id   TEXT NOT NULL DEFAULT generate_str_uuid() PRIMARY KEY,
    email         VARCHAR UNIQUE,
    username      VARCHAR,
    password      VARCHAR,
    profile_info  TEXT,
    profile_image TEXT
);
CREATE TABLE tables
(
    table_id     SERIAL PRIMARY KEY,
    availability boolean
);

CREATE TABLE restaurants
(
    restaurant_id    TEXT NOT NULL DEFAULT generate_str_uuid() PRIMARY KEY,
    name             VARCHAR,
    description      TEXT,
    profile_image    TEXT,
    address          VARCHAR,
    working_schedule VARCHAR,
    table_id_key     INT REFERENCES tables (table_id) ON DELETE CASCADE
);

CREATE TABLE reservations
(
    reservation_id         SERIAL PRIMARY KEY,
    date_time              TIMESTAMP,
    reserved_customer_id   VARCHAR REFERENCES customers (customer_id),
    reserved_restaurant_id VARCHAR REFERENCES restaurants (restaurant_id),
    reserved_table_id      INT REFERENCES tables (table_id)
);

